import React from "react";
import useGoogleAnalitics from '../../../hooks/useGoogleAnalitics';
import { Chart } from '../../';

const GoogleAnalitics = () => {
    const {
        visitsDataChart
    } = useGoogleAnalitics();
    return (
        <div className='general-container'>
            <Chart options={visitsDataChart} />
        </div>
    )
}
export default GoogleAnalitics;
